<img src="/img.png" class="float-right h-[220px] m-2" />

- 第一层：**熟能生巧** - 指定更加标准的工程约定，使其工作更轻松过，包括统一框架，统一的第三方库，统一的包管理工具，统一的项目结构，统一的代码提交标准
- 第二层：**使团队成为更薄的刀** - 把常见的业务常见二次封装成已用的公共组件，如经典的条件查询列表页等
